import React, { Component } from "react";
import { connect } from "react-redux";
import { push } from "connected-react-router";
import TextField from "@material-ui/core/TextField";
import List from "@material-ui/core/List";
import styled from "styled-components";
import { getTripDetails } from "../../actions/trips";
import { ListItem } from "@material-ui/core";

const TripDetailsWrapper = styled.form`
  width: 100%;
  height: 100vh;
  gap: 10px;
  place-content: center;
  justify-items: center;
  display: grid;
`;

class TripDetailsPage extends Component {
  constructor(props) {
    super(props);

  }

 componentDidMount() {
   console.log(this.props.tripId)
   this.props.getTripDetails(this.props.tripId);
 }

  render() {
    const tripId = this.props.tripId;
    return (
      <TripDetailsWrapper>
        <List>
          <ListItem>
            Nome: {tripId.name}
          </ListItem>
          <ListItem>
            Planeta: {tripId.planet}
          </ListItem>
          <ListItem>
            Duração: {tripId.durationInDays}
          </ListItem>
          <ListItem>
            Descrição: {tripId.description}
          </ListItem>
        </List> 
        <List>
          <ListItem>
            Candidatos: {tripId.candidates}
          </ListItem>
          <ListItem>
            Planeta: {tripId.planet}
          </ListItem>
          <ListItem>
            Duração: {tripId.durationInDays}
          </ListItem>
          <ListItem>
            Descrição: {tripId.description}
          </ListItem>
        </List> 
      </TripDetailsWrapper>
    );
  }
}

const mapStateToProps = state => ({
  tripId: state.trips.tripId
});


function mapDispatchToProps(dispatch) {
  return {
    getTripDetails: (tripId) => dispatch(getTripDetails(tripId)),
 };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(TripDetailsPage);
